INSERT INTO `cms_variable` VALUES (1,1,'WHAT_IS_PUNTO_PICKIT','¿Qué es Punto Pickit?','Texto HTML correspondiente a la pregunta [¿Qué es Punto Pickit?] desplegada en el footer del lightbox','<p>\n<span class=\"black-text bold\">¿Qué es un Punto Pickit?</span><br>\n<span class=\"grey-text\">Es un punto por donde podés retirar lo que compraste en la web. Sólo tenés que buscar el Punto Pickit más cercano y seleccionarlo como lugar por donde pasar a retirar tu compra. Gracias a Pickit, ya no tenés que quedarte en casa esperando tu envío, ni tampoco ir al local de la tienda online a retirar lo que compraste. Nosotros nos encargamos de llevar el paquete hasta el punto que seleccionaste para hacerte más fácil su retiro.</span>\n</p>\n<p>\n<span class=\"black-text bold\">¿Donde los encuentro?</span><br>\n<span class=\"grey-text\">Podés encontrar los Puntos Pickit en Cafeterías, Pinturerías, Tiendas de indumentaria, Kioscos de Diarios y más. Vas a encontrar siempre un Punto Pickit cerca tuyo.</span>\n</p>\n<p>\n<span class=\"black-text bold\">¿En que horarios operan?</span><br>\n<span class=\"grey-text\">El horario de atención del Punto Pickit coincide con el horario de atención del comercio donde está ubicado. Podés ver la franja horaria de atención al cliente junto a la dirección de cada Punto Pickit.</span>\n</p>',1),(2,1,'NEED_HELP','¿Necesitas Ayuda?','Texto HTML correspondiente a la pregunta [¿Necesitas Ayuda?] desplegada en el footer del lightbox','<p>\n<span class=\"black-text bold\">Atención al cliente Pickit</span><br>\n<span class=\"grey-text\">Ante cualquier duda que tengas durante el proceso de retiro de tu compra, podés llamarnos al 0800-345-3451, estamos para ayudarte</span>\n</p>\n<p>\n<span class=\"black-text bold\">Cómo puedo averiguar el estado de mi envío?</span><br>\n<span class=\"grey-text\">Una vez que hayas terminado el proceso de checkout, recibirás un mail de Pickit informándote que tu pedido ha sido confirmado y será preparado para entrega en el punto escogido. Es importante que no concurras al comercio hasta que recibas el mail de Pickit confirmándote que tu pedido ya está disponible para ser retirado.\nTené en cuenta que vas a recibir diferentes mails durante el proceso de retiro de tu compra:<br><br>\n<img src=\"http://core.pickitlabs.com/bundles/app/img/compra.gif\" alt=\"Proceso\" ><br>\n  <span class=\"grey-text bold\">Gracias por elegir Pickit</span><br> Este mail te confirma que la operación de selección de Punto Pickit ha sido satisfactoria y que la tienda online procesará tu compra con destino hacia el punto elegido.<br></li>\n  <span class=\"grey-text bold\">Tu pedido está en camino\"</span><br> Este mail es para confirmarte que tu envío ya se encuentra en tránsito hacia el Punto Pickit. Todavía no necesitas acercarte hasta el punto de retiro ya que el paquete no ha llegado aún.<br></li>\n  <span class=\"grey-text bold\">Ya podés retirar tu compra\"</span><br> En este mail te incluiremos la Clave de Seguridad de 4 dígitos que necesitarás para retirar tu compra. Esta clave te asegura que sólo vos puedas retirar el paquete.</span></li>\n</p>\n<p>\n<span class=\"black-text bold\">Cuanto tiempo tengo para retirar mi paquete?</span><br>\n<span class=\"grey-text\">El servicio te ofrece un plazo de 7 días hábiles para retirar tu pedido del punto de entrega seleccionado al momento de realizar la compra. Vencido dicho plazo, el paquete es enviado nuevamente a la Tienda On-Line en donde lo compraste. Para reprogramar nuevamente el envío debés comunicarte con la Tienda On Line donde realizaste la compra.</span>\n</p>',1),(3,2,'FAQ1','Primera Pregunta','Texto HTML correspondiente a la primera pregunta desplegada en el dashboard de la WebApp Punto Pickit','<p>Preguntas frecuentes 1? bienvenido Pickit ...</p>',1),(4,2,'FAQ2','Segunda Pregunta','Texto HTML correspondiente a la segunda pregunta desplegada en el dashboard de la WebApp Punto Pickit','<p>Preguntas frecuentes 2? bienvenido a ...</p>',1),(5,2,'FAQ3','Tercera Pregunta','Texto HTML correspondiente a la tercera pregunta desplegada en el dashboard de la WebApp Punto Pickit','<p>Preguntas frecuentes 3? bienvenido a ...</p>\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/WKB0JUkksJg\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>',1),(6,1,'BANNER_MAINPAGE','Banner Mainpage','Comunicación directa al operador de Puntos en donde poder incluir semanalmente novedades relacionadas a: nuevos sitios, promociones, recomendaciones, etc','imagen_banner_20181012_0152061539370326.gif',1),(7,1,'BANNER_TRANSACTIONAL','Banner Transacitional','Comunicación directa al operador de Puntos en donde poder incluir semanalmente novedades relacionadas a: nuevos sitios, promociones, recomendaciones, etc','imagen_banner_20181003_0330401538598640.gif',1);
