INSERT INTO `plantilla` VALUES (1,'Punto Pickit - Devolución - En retailer','EmailConsumidorDevolucionPunto','{# app/Resources/views/Emails/EmailsPuntoPickit/nuevo_pedido_de_retiro.html.twig #}\n <html>\n     <head>\n 	</head>\n     <body bgcolor=\"#F8F8F8\" leftmargin=\"0\" topmargin=\"0\" marginwidth=\"0\" marginheight=\"0\" rightmargin=\"0\" style=\"font-family: arial, verdana, sans-serif;\"> \n 		<div style=\"background-color: #ffa000; height:180px; padding:0px; min-width:650px;\">\n 			<div style=\"width:80%; margin:0 auto; position:relative;\">\n				<div style=\"width:215px; height:105px; float:left; margin-top:20px; position:absolute;\">\n					<table background=\"{{UrlImagenes}}logo-header.png\" style=\"width: 215px; height: 105px;\">\n						<tbody>\n							<tr>\n								<td></td>\n							</tr>\n						</tbody>\n					</table>\n				</div>\n 				<div style=\"color:#fff; float:right; margin-top:25px;\"><h1 style=\"font-weight: 100;\">Devolución en retailer</h1></div>\n 			</div>\n 		</div>\n 		<div style=\"clear:both;\"></div>\n 	<div style=\"padding: 20px; margin: 0 auto;border-radius: 2px; background-color: #fff; min-width:600px; margin-top: -45px !important; height:600px ; margin-bottom:20px; width:80%; box-shadow: 0 2px 5px 0 rgba(0, 0, 0, 0.16), 0 2px 10px 0 rgba(0, 0, 0, 0.12);}\">\n 			<div style=\"width:100%;\">			\n				<div style=\"width:100%;\">\n					<div style=\"color: #ffa000; font-size: 41px; font-weight: 400; margin-top: -4px;\">{{NumeroPickit}}</div>\n					<div style=\"font-size: 15px; margin-top: -5px; color: #9e9e9e \">NÚMERO PICKIT</div>\n					<hr>\n					<div style=\"font-size:14px;\"><p>TRACKING: {% if estadoInicial %}<img src=\"{{ImgTrackingDevolucionDomicilioFinalizada}}\">{% else %}<img src=\"{{ImgTrackingDevolucionFinalizada}}\">{% endif %} </p></div>\n					<div style=\"font-size:14px;\"><p>La devolución solicitada ya se encuentra en {{NombreRetailer}}</p></div>\n				</div>				\n			</div>\n		</div>\n 	</body>\n </html>','<html>\n	<head>\n	</head>\n    <body bgcolor=\"#fff\" leftmargin=\"0\" topmargin=\"0\" marginwidth=\"0\" marginheight=\"0\" rightmargin=\"0\" style=\"font-family: montserrat, sans-serif;\">\n 		<div style=\"background-color: #FFF; height:180px; width:100%;\">\n			<div style=\"width:90%; margin:0 auto; padding-top:10px;text-align:center\">\n				 <img src=\"{{LogoRetailer}}\" style=\"height: 105px; margin: 0 auto;\"/>\n					<tbody>\n						<tr>\n							<td></td>\n						</tr>\n					</tbody>\n				</table>\n				<div style=\"color:#F8BC33;  margin:0 auto; text-align:center; margin-top:5px;\">\n					<span style=\"font-weight: bold; font-size:24px; padding-bottom:20px;\">Devolución entregada a {{NombreRetailer}}</span>\n				</div>\n			</div>\n		</div>\n		<div style=\"width:90%; margin:0 auto;\">	\n				<hr>\n			<div style=\"font-size: 18px; margin-top: 8px; color: #9e9e9e \">CÓDIGO DE SEGUIMIENTO</div>\n			<div style=\"color: #ffa000; font-size: 41px; font-weight: 400;\">{{NumeroPickit}}</div>\n			<hr>\n			<div style=\"font-size:14px;\"><p><img src=\"{{ ImgTrackingDevolucionFinalizada }}\" /> </p></div>\n			<br>\n			<div style=\"font-size:14px;\"><p>La devolución solicitada ha sido recibida por la tienda online donde realizaste la compra.<br>\n			<br>\n			Ante cualquier duda o consulta con respecto al cierre de la operación de devolución, contactate con {{NombreRetailer}}.</p>			\n			<br>\n			<p>Te agradecemos la confianza depositada en nuestro servicio de Devoluciones.</p>\n			<p><a>Te invitamos a que nos cuentes sobre tu experiencia de uso ingresando a una breve encuesta <a href=\"https://www.survio.com/survey/d/pickitdevolucion\">aquí.</a></p></div>\n			<br>\n		</div>\n		<div style=\"width:90%; margin:0 auto;\">\n 			<div style=\"font-size:14px;\">\n 				<h2 style=\"font-weight:100;\">Gracias por elegir Pickit</h2>\n				<p>CERCA TUYO. SIMPLE. CÓMODO.</p>\n 				<br>\n 				<p><span style=\"font-weight:bold;\">Pickit</span>\n 				<br>\n				Mariscal A.J. de Sucre 1530 - CABA<br>\n				Chat: www.pickit.com.ar<br>\n				Mail: contacto@pickit.com.ar\n 			</div>\n 		</div>\n 	</body>\n </html>\n \n','Devolución entregada en {{NombreRetailer}}',1,NULL,NULL,NULL),(2,'Punto Pickit - Devolución - Solicitada','EmailConsumidorDevolucionPunto','<html>\n <head>\n </head>\n    <body bgcolor=\"#fff\" leftmargin=\"0\" topmargin=\"0\" marginwidth=\"0\" marginheight=\"0\" rightmargin=\"0\" style=\"font-family: arial, verdana, sans-serif;\"> \n		<div style=\"background-color: #ffa000; height:260px; width:100%;\">\n			<div style=\"width:90%; margin:0 auto; padding-top:10px; \">\n				 <table background=\"{{UrlImagenes}}logo-header.png\" style=\"width: 215px; height: 105px; margin: 0 auto;\">\n					<tbody>\n						<tr>\n							<td></td>\n						</tr>\n					</tbody>\n				</table>\n				<div style=\"color:#fff;  margin:0 auto; text-align:center; margin-top:5px;\">\n					<span style=\"font-weight: bold; font-size:35px; padding-bottom:20px;\">Ya podés realizar la devolución de tu pedido {{NombreRetailer}}</span>\n				</div>\n			</div>\n		</div>\n 		<div style=\"width:90%; margin:0 auto;\">\n 			<div style=\"font-size: 15px; margin-top: 2px; color: #9e9e9e \">NÚMERO PICKIT</div>\n			<div style=\"color: #ffa000; font-size: 41px; font-weight: 400;\">{{NumeroPickit}}</div>\n 			<hr>\n			<div style=\"font-size:14px;\"><p>TRACKING: <img src=\"{{ImgTrackingDevolucionSolicitada}}\"/> </p></div>\n 			<div style=\"font-size:14px;\"><p>Acercate al Punto Pickit que elegiste y traenos tu devolución de {{NombreRetailer}}.</p></div>\n			<div style=\"font-size:14px;\">\n			<p><b>¿Qué debo hacer ahora?</b></p>	\n			<ul>\n				<li>Paso 1: Imprimí la etiqueta haciendo <a href=\"{{UrlEtiqueta}}\">CLICK AQUÍ</a></li>\n				<li>Paso 2: Embalá tu producto con un material opaco, puede ser la bolsa original u otra oscura y pegale la etiqueta para que no se despegue durante el viaje</li>\n				<li>Paso 3: Acercate al Punto Pickit que seleccionaste (Ver ubicación más abajo)</li>\n				<li>Paso 4: Entregá tu devolución</li>\n				<li>Paso 5: Recibirás un mail con el acuse de recibo de tu devolución</li>\n				</ul>\n			</div>\n		</div>\n 		<div style=\"width:90%; margin:0 auto;\">\n 			<div style=\"background-color: #eeeeee; height:240px;\">\n 				<div style=\"font-size:13px; padding: 10px; float:left; line-height: 20px;\"><h2 style=\"font-weight:100;\">{{NombreCadena}} {{NombreSucursal}}</h2>\n 					<br>{{direccion}}<br>\n 					<br>Horario de retiro:\n                     {% for horario in Horarios %}\n                         <br>{{horario.Dias}} de {{horario.HoraInicio}} a {{horario.HoraFin}}\n                     {% endfor %}\n 				</div>\n 			</div>\n			\n			<div style=\"width:100%; margin-top:10px;\">\n				<img style=\"max-width:100%;height:auto;width:auto9;display:block;margin:auto;\" src=\"{{Mapa}}\" alt=\"\">\n			</div>\n			\n 			<div style=\"font-size:14px;\">\n 				<h2 style=\"font-weight:100;\">Gracias por elegir Pickit</h2>\n				<p>Hacemos más simple y práctico tu proceso de compra online.</p>\n					<br>\n					<p><span style=\"font-weight:bold;\">Pickit</span>\n					<br>\n					La Pampa 1517 - CABA<br>\n					Tel: 0800-345-3451<br>\n					Mail: contacto@pickit.com.ar<br>\n 			</div>\n 		</div>\n </body>\n </html>','<html>\n	<head>\n	</head>\n    <body bgcolor=\"#fff\" leftmargin=\"0\" topmargin=\"0\" marginwidth=\"0\" marginheight=\"0\" rightmargin=\"0\" style=\"font-family: montserrat, sans-serif;\">\n 		<div style=\"background-color: #FFF; height:180px; width:100%;\">\n			<div style=\"width:90%; margin:0 auto; padding-top:10px;text-align:center\">\n				 <img src=\"{{LogoRetailer}}\" style=\"height: 105px; margin: 0 auto;\"/>\n					<tbody>\n						<tr>\n							<td></td>\n						</tr>\n					</tbody>\n				</table>\n				<div style=\"color:#F8BC33;  margin:0 auto; text-align:center; margin-top:5px;\">\n					<span style=\"font-weight: bold; font-size:24px; padding-bottom:20px;\">Ya podés acercarnos tu Devolución</span>\n				</div>\n			</div>\n		</div>\n 		<div style=\"width:90%; margin:0 auto;\">\n				<hr>\n 			<div style=\"font-size: 18px; margin-top: 8px; color: #9e9e9e \">CÓDIGO DE SEGUIMIENTO</div>\n			<div style=\"color: #ffa000; font-size: 41px; font-weight: 400;\">{{NumeroPickit}}</div>\n 			<hr>\n 			<img src=\"{{ ImgTrackingDevolucionSolicitada }}\" />\n 			<div style=\"font-size:14px;\"><p>Acercate al Punto Pickit seleccionado y traenos tu devolución de {{NombreRetailer}}.</p></div>\n			<br>\n			<div style=\"font-size:14px;\">\n			<p><b>Pasos a seguir:</b></p>	\n			<ul>\n				<li>Paso 1: Imprimí la etiqueta haciendo <a href=\"{{UrlEtiqueta}}\">CLICK AQUÍ</a></li>\n				<li>Paso 2:  Embalá tu producto con un material opaco, puede ser la bolsa original u otra oscura.                     Asegurate de sellar todos su lados con cinta adhesiva evitando un fácil acceso al producto.</li>\n				<li>Paso 3: Pegale la etiqueta de manera que no se despegue durante el viaje.</li>\n				<li>Paso 4: Acercate al Punto Pickit coordinado con {{NombreRetailer}} (Ver ubicación más abajo).</li>\n				<li>Paso 5: Llevá tu DNI junto con el código de seguimiento y entregá tu producto a devolver.</li>\n				<li>Paso 6: Vas a recibir un mail confirmando que tu devolución está en curso.</li>\n				<li>Paso 7: Enviaremos tu paquete a la tienda online donde realizaste la compra.</li>\n				<li>Paso 8: Te avisamos cuando hayamos entregado tu paquete a {{NombreRetailer}}.</li>\n				<li>Paso 9: Listo! Ya podés contactarte con la tienda online para seguir el proceso.</li>\n				<br>\n				</ul>\n			</div>\n		</div>\n 		<div style=\"width:90%; margin:0 auto;\">\n 			<div style=\"background-color: #eeeeee; height:240px;\">\n 				<div style=\"font-size:13px; padding: 10px; float:left; line-height: 20px;\"><h2 style=\"font-weight:100;\">{{NombreCadena}} {{NombreSucursal}}</h2>\n 					<br>{{direccion}}<br>\n 					<br>Horario de entrega:\n                     {% for horario in Horarios %}\n                         <br>{{horario.Dias}} de {{horario.HoraInicio}} a {{horario.H