; margin-top: 8px; color: #9e9e9e \">CÓDIGO DE SEGUIMIENTO</div>\n                <div style=\"color: #F8BC33; font-size: 41px; font-weight: 400;\">{{NumeroPickit}}</div>\n                    <hr>\n                    <img src=\"{{ ImgTrackingEnvioEnPunto }}\" />\n                    <div style=\"font-size:14px;\"><p>Tu pedido {{NombreRetailer}} ya se encuentra listo para ser retirado en el punto que elegiste.</p></div>\n                \n       \n                    <div style=\"clear:both;\"></div>\n                    <div style=\"font-size:14px;\">\n                       <p><b>¿Qué tenés que hacer ahora?</b></p>\n                       {% if retailerUseValidationToken %}\n                            <p>Acercate al Punto Pickit que elegiste con tu DNI y código de seguimiento que figura en este mail.</p>\n                            <p><b>IMPORTANTE</b></p>\n                            <p>Tenés 7 días para retirar tu paquete del Punto Pickit seleccionado, pasada esa fecha será devuelto a {{NombreRetailer}}</p>\n                            <br>\n                            \n                       {% else %}\n                            <p>Paso 1: Acércate al Punto de Retiro que elegiste con tu DNI</p>\n                            <p>Paso 2: Utiliza el Número Pickit que se informa en este correo para retirar tu envío</p>\n                        {% endif %}\n                       <br>\n                       <img src=\"{{ ImgQRAppMobile }}\" />\n                   </div>\n                       \n                   <div style=\"font-size:14px;\">	\n                       <a style=\"color: #F8BC33; text-decoration:none\" href=\"{{UrlTerceros}}\" >¿Querés autorizar a otra persona a que retire tu pedido?</a>\n                   </div>\n                  <br>\n                      <br>\n                    <div style=\"background-color: #eeeeee; height:240px;\">\n                        <div style=\"font-size:13px; padding: 10px; float:left; line-height: 20px;\"><h2