100;\">Gracias por elegir Pickit</h2>\n				<p>CERCA TUYO. SIMPLE. CÓMODO.</p>\n					<br>\n					<p><span style=\"font-weight:bold;\">Pickit</span>\n					<br>\n					Mariscal A.J. de Sucre 1530 - CABA<br>\n					www.pickit.com.ar<br>\n					contacto@pickit.com.ar<br>\n					</p>\n				<div style=\"width:100%; margin-top:10px;\">\n				<img style=\"max-width:100%;height:auto;width:100%;display:block;margin:auto;\" src=\"{{UrlImagenes}}banner-InMail-small.jpg\" alt=\"\">\n			</div>	\n				</div>\n		</div>\n\n	</body>\n</html>','{{NombreRetailer}} - Selecciona el punto para hacer tu devolución.',1,0,NULL,NULL),(59,'Punto Pickit - Courier - Recuperar contraseña','EmailGeneralContraseña','<html></html>','<html></html>','Pickit - Recuperación de contraseña',1,NULL,NULL,NULL);
